    def get_cme_project(self, page_max_id: int, page_size: int, *args, **kwargs) -> list:
        table_metadata_all = []
        table_metadata_header = ['项目编号', '项目名称', '申办单位', '举办开始时间', '举办结束时间', '举办天数', '授予学分', '举办地点', '教学对象', '拟招生人数', '项目负责人', '备注', '负责人电话', 'batch_number']
