    # 获取贵州CME页面数据
    def _get_html(self, page_id: int, page_size: int, *args, **kwargs) -> str:
        headers = {'User-Agent': 'Mozilla/5.0 (Windows',
                   'Content-Type': 'application/x-www-form-urlencoded',
                   'Accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.7',
                   'Referer': 'https://gzcme1.yiboshi.com/ProjectSearch/ProjectList.aspx?notype=0'}

        url = 'https://gzcme1.yiboshi.com/ProjectSearch/ProjectList.aspx?notype=0'

        data = {
            "__VIEWSTATE": "",

            "__EVENTVALIDATION": "",

            "__VIEWSTATEGENERATOR": "__VIEWSTATEGENERATOR",
            "ddlYear": "2025",
            "ddlknowledgeType": "",
            # "ddlknowledge2": "597",
            # "ddlknowledge3": "0",
            # "selectState": "0",
            # "selectHoldState": "0",
            # "ddlIsReback": "0",
            # "ddlScoreLevel": "1",
            # "ddlScore": "1",
            "grvList$ctl103$grvListB_ddl": page_id,
            "grvList$ctl103$grvListB_ddlSize": page_size
        }

        print(url)
        response = requests.post(url=url, data=data, headers=headers)
        cme_html = response.text
        return cme_html

    def _table_data(self, html, *args, **kwargs) -> list:
        """
        对传入的HTML页面处理,返回页面中第一个表格中数据
        :param html: HTML页面
        :return: list
        """
        soup = BeautifulSoup(html, 'lxml')  # 使用BeautifulSoup解析HTML
        tables = soup.find_all('table')  # 查找所有的<table>标签
        table = tables[1]  # 这里我们只关心页面的第一个表格
        rows = table.find_all('tr')  # 提取表格的行和列
        table_data = []  # 初始化一个列表来存储表格数据

        for row in rows:
            # cols 基础数据列表
            cols = row.find_all('td')
            cols = [ele.text.strip().replace('\xa0', '') for ele in cols]

            # a标签按钮,项目详细信息以获取手机号,举办天数
            bt_a = row.find_all('a')
            # bt_a = [ele.text.strip().replace('\xa0', '') for ele in bt_a]

            if len(cols) > 1:
                "1. 去除不需要的数据列"
                cols.pop(0)  # 查看项目信息
                cols.pop(3)  # 学分级别
                cols.pop(3)  # 项目级别

                "2.去出学分字段分字"
                credit = cols[4].rsplit('分')[0]
                cols.pop(4)
                cols.insert(4, credit)

                "3.拆分起始日期与举办天数"
                startdate = cols[3].rsplit('至')[0]
                enddate = cols[3].rsplit('至')[1]

                cols.pop(3)
                cols.insert(3, startdate)
                cols.insert(4, enddate)

                "4. 获取项目详细信息 "
                bt_projectid = bt_a[-1].get('onclick').rsplit("'")[1]  # 获取查看按钮 项目详情ID 值
                project_info = self.__get_project_info(bt_projectid)
                tel = project_info.get('tel')
                date_num = project_info.get('date_num').rsplit('天')[0]
                cols.append(tel)
                cols.insert(5, date_num)

                "5. 批次号"
                cols.append('2025-01（黔）')

                "6. 写入列表 并 过滤掉空值,给默认字符null"
                default_string = 'null'
                table_data.append([ele if ele else default_string for ele in cols])
        return table_data

    def __get_project_info(self, bt_projectid, *args, **kwargs):
        """
        bt_projectid: 查看button projectId
        :return:
        """
        URL = f'https://gzcme1.yiboshi.com/Goverment/Search/AuditContent.aspx?id={bt_projectid}'
        response = requests.get(URL)
        teacher_html = response.text
        soup = BeautifulSoup(teacher_html, 'lxml')
        rows = soup.find_all('tr')
        project_info = {"tel": "", "date_num": ""}

        row_1 = rows[1]
        row_2 = rows[3]

        # 1. 获取手机号
        for td in row_1.find_all('td')[-1]:
            tel = td.text.strip()
            project_info.update({"tel": tel})

        # 2. 获取举办期限
        for td in row_2.find_all('td')[-1]:
            date_num = td.text.strip()
            project_info.update({"date_num": date_num})

        return project_info


